<H1><A NAME="prf4541"></A><SUP></SUP>Profiler Error PRF4541</H1>

<P class=dt><B>warning -- PROFILE -- module not found in PBI file filename</B></P>

<P>An attempt was made to profile a program, but the EXE was not modified by PREP. This warning occurs while selectively profiling a DLL that is called by the EXE.</P>
